import React, { useEffect } from 'react'
import {useParams } from 'react-router-dom'
import { useDispatch, useSelector } from 'react-redux'


import { modelImage } from '../actions/productActions'


function AiModelScreen() {  

  const params = useParams();
  const dispatch = useDispatch();

  const imageData = useSelector(state => state.image);
  const { image } = imageData;
  const text = "a red horse in the nature"

  useEffect(() => {
    dispatch(modelImage(`${text}`))

  }, [dispatch, params])

  const runModel = () => {
    console.log(image)
    console.log(image)
  }


  return (
    <div>
      <h1> Stable Diffusion Model</h1>
      <button onClick={() => runModel()}>run</button>
    </div>
  )
}

export default AiModelScreen
